INSERT INTO `news` VALUES (1,'Test','2022-01-10 00:27:56','2022-06-06 06:52:25','2022-06-06 06:52:25',1,'Test','Test Detail','1-n-ws-1641969087.pdf','https://www.google.com',0,NULL),(2,NULL,'2022-01-12 01:03:11','2022-06-06 06:52:25','2022-06-06 06:52:25',1,'Hang On Systems','Free','1-n-ws-1641969191.pdf','www.google.com',0,NULL),(3,NULL,'2022-01-12 01:04:15','2022-06-06 06:52:25','2022-06-06 06:52:25',1,'Cyber World','Free','1-n-ws-1641969255.pdf','www.xuvi.com',0,NULL),(4,NULL,'2022-01-13 13:54:26','2022-06-06 06:52:25','2022-06-06 06:52:25',1,'Test Ad by Puneet','Test Ad by Puneet','1-n-ws-1642101866.pdf',NULL,0,NULL),(5,NULL,'2022-02-11 02:07:34','2022-06-06 06:52:25','2022-06-06 06:52:25',114,'Delhi News Live Updates: Gurgaon apartment roof collapse: 2 dead, bureaucrat rescued; FIR against builder','The builder of Chintel Paradiso society in Gurgaonâ€™s Sector 109 was booked on Friday, a day after a chunk of the sixth floor collapsed all the way down to the first floor, killing at least one resident. Gulshan Kalra, Deputy Director of the fire department, has confirmed that Bureaucrat Arun Srivastava has been rescued, and his wife has died, taking the death toll to 2.  Meanwhile, protests were held in several areas of the national capital against the hijab curbs in Karnataka, with police registering an FIR against five people over a march held at Delhi Universityâ€™s Chhatra Marg. Also, the Delhi governmentâ€™s draft policy for aggregators and delivery firms, which makes it mandatory for them to induct electric vehicles while procuring a new fleet, has been put up in the public domain, inviting suggestions and objections of the general public within a period of 60 days. It was first notified on January 14.','114-n-ws-1644565054.pdf','www.google.com',0,NULL),(6,NULL,'2022-02-11 02:10:24','2022-06-06 06:52:25','2022-06-06 06:52:25',114,'How Dilip Kumarâ€™s innocent remark in 1947 sent Lata Mangeshkar on the path to greatness','Late singer Lata Mangeshkar once recalled how her first meeting with actor Dilip Kumar compelled her to improve her Urdu diction. It was an innocent remark that the actor had made during their first meeting, in 1947, that made her introspect, and ultimately resulted in some timeless numbers such as â€œPyaar Kiya Toh Darna Kyaâ€ from the classic film Mughal-e-Azam, starring Kumar.  She recalled the story in Kumarâ€™s 2014 autobiography The Substance and the Shadow. Mangeshkar was introduced to Kumar by composer Anil Biswas aboard a local train. When the actor asked where she is from, Biswas told him her full name.','114-n-ws-1644565224.pdf','www.google.com',0,NULL),(7,NULL,'2022-02-11 02:12:55','2022-06-06 06:52:25','2022-06-06 06:52:25',114,'HC notice to Centre after Indian students of Chinese university seek to complete practical medical training in India','The Delhi High Court on Thursday asked the Centre and the National Medical Commission (NMC) to respond to a petition, filed by Indian students of medicine enrolled in a Chinese university, seeking directions to allow them to undertake practical training in India as they are unable to return to China due to pandemic travel restrictions. The division bench of Chief Justice D N Patel and Justice Jyoti Singh listed the case for hearing on March 21.','114-n-ws-1644565375.pdf','www.google.com',0,NULL),(8,NULL,'2022-02-11 02:13:06','2022-06-06 06:52:25','2022-06-06 06:52:25',114,'HC notice to Centre after Indian students of Chinese university seek to complete practical medical training in India','The Delhi High Court on Thursday asked the Centre and the National Medical Commission (NMC) to respond to a petition, filed by Indian students of medicine enrolled in a Chinese university, seeking directions to allow them to undertake practical training in India as they are unable to return to China due to pandemic travel restrictions. The division bench of Chief Justice D N Patel and Justice Jyoti Singh listed the case for hearing on March 21.','114-n-ws-1644565386.pdf','www.google.com',0,NULL),(9,NULL,'2022-02-11 02:13:36','2022-06-06 06:52:25','2022-06-06 06:52:25',114,'Delhi: Admissions for 31 specialized excellence schools to start from March 15','Admissions to 31 Schools of Specialized Excellence (SOSEs), including an Armed Forces Preparatory School, for the 2022-2023 session will start from March 15. Last year, the first batch of students had been admitted to 20 of the Delhi governmentâ€™s new SOSEs, each specializing either in STEM, Humanities, High End 21st Century Skills, or Performing and Visual Arts.','114-n-ws-1644565416.pdf','www.google.com',0,NULL),(10,NULL,'2022-06-06 06:06:23','2022-06-06 06:51:39','2022-06-06 06:51:39',114,'Petrol, Diesel Prices Today, November 11: Fuel prices unchanged for 7th straight day, check prices in your city','Test','114-n-ws-1654495583.png','www.google.com',0,'Private Notice'),(11,NULL,'2022-06-06 06:54:16','2022-06-06 06:54:16',NULL,114,'Nation rattled by brutality that Kashmiri Pandits are facing: Delhi CM Arvind Kejriwal','Nation rattled by brutality that Kashmiri Pandits are facing: Delhi CM Arvind Kejriwal','114-n-ws-1654498456.pdf','www.google.com',0,'Public Notice'),(12,NULL,'2022-06-06 06:55:47','2022-06-06 06:55:47',NULL,114,'Delhi News Live Updates: Mercury likely to touch 44 degree Celsius; heatwave warning issued','Delhi News Live Updates: Mercury likely to touch 44 degree Celsius; heatwave warning issued','114-n-ws-1654498547.pdf','www.google.com',0,'Private Notice'),(13,NULL,'2022-06-06 06:57:31','2022-06-06 06:57:31',NULL,114,'Delhi weather forecast: Mercury up, but rain may bring relief in a few days','Delhi weather forecast: Mercury up, but rain may bring relief in a few days','114-n-ws-1654498651.pdf','www.google.com',0,'Public Notice'),(14,NULL,'2022-06-06 06:59:11','2022-06-06 06:59:11',NULL,114,'AAP takes another dig at Delhi\'s new LG, says Centre must\'ve sent him to meddle with govt work','AAP takes another dig at Delhi\'s new LG, says Centre must\'ve sent