INSERT INTO `pages` VALUES (1,'2021-06-07 23:52:57','2021-06-07 23:52:57',NULL,'<p><strong>Privacy Policy</strong></p>','privacy_policy','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Sed viverra tellus in hac habitasse platea. Erat pellentesque adipiscing commodo elit at imperdiet dui. Maecenas volutpat blandit aliquam etiam erat velit. Ultricies leo integer malesuada nunc vel. Ut tristique et egestas quis ipsum suspendisse ultrices gravida dictum. Eu turpis egestas pretium aenean pharetra magna. Quam lacus suspendisse faucibus interdum. Urna molestie at elementum eu facilisis sed. Odio eu feugiat pretium nibh ipsum consequat nisl. Ut venenatis tellus in metus vulputate eu scelerisque.</p>'),(2,'2021-07-21 02:08:35','2021-07-21 02:08:35',NULL,'<p><strong>Terms Of Use</strong></p>','terms_of_use','<p>Dummy Data for Terms Of Use -&gt; Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Sed viverra tellus in hac habitasse platea. Erat pellentesque adipiscing commodo elit at imperdiet dui. Maecenas volutpat blandit aliquam etiam erat velit. Ultricies leo integer malesuada nunc vel. Ut tristique et egestas quis ipsum suspendisse ultrices gravida dictum. Eu turpis egestas pretium aenean pharetra magna. Quam lacus suspendisse faucibus interdum. Urna molestie at elementum eu facilisis sed. Odio eu feugiat pretium nibh ipsum consequat nisl. Ut venenatis tellus in metus vulputate eu scelerisque.</p>'),(3,'2021-08-08 23:49:37','2021-08-08 23:49:37',NULL,'<p><strong>How I edit my Profile ?</strong></p>','faq','<p>Click on Left &nbsp;side of App &nbsp;on icon and click on pencil icon for editing any details</p>'),(4,'2021-08-09 00:03:21','2021-08-09 00:03:21',NULL,'<p><strong>How I get my &nbsp;posted Ad</strong></p>','faq','<ol><li>Click on left up corner profile icon you see side window section where you get Names My ads ,My Jobs , My Events.&nbsp;</li><li>Click on Any Nme lIke my Ads &nbsp;open A Top Row Menu Where You &nbsp;Have to click On Posted Menu . Here you will see all Your Posted ads . And also Your Saved Applied, All Sections here you can browse.</li></ol>'),(5,'2021-08-09 00:08:14','2021-08-09 00:08:34',NULL,'<p><strong>Where I can Post Ad ,Job etc .</strong></p>','faq','<ol><li>See Bottom Navigation Menu In App .</li><li>Click On Any Menu Name Like Ad</li><li>This will open All Users Posted Ad and Right &nbsp;Bottom Corner You see a Yellow Circle Name <strong>Posted Ad</strong> &nbsp;.</li><li>Click on this You can Post Your Data Here.</li></ol>'),(6,'2021-08-09 00:12:36','2021-08-09 00:12:36',NULL,'<h2>About Us :-</h2>','about_us','<p>A <strong>mobile application</strong>, also referred to as a <strong>mobile app</strong> or simply an <strong>app</strong>, is a <a href=\"https://en.wikipedia.org/wiki/Computer_program\">computer program</a> or <a href=\"https://en.wikipedia.org/wiki/Software_application\">software application</a> designed to run on a <a href=\"https://en.wikipedia.org/wiki/Mobile_device\">mobile device</a> such as a <a href=\"https://en.wikipedia.org/wiki/Smartphone\">phone</a>, <a href=\"https://en.wikipedia.org/wiki/Tablet_computer\">tablet</a>, or <a href=\"https://en.wikipedia.org/wiki/Smartwatch\">watch</a>. Mobile applications often stand in contrast to <a href=\"https://en.wikipedia.org/wiki/Desktop_application\">desktop applications</a> which are designed to run on <a href=\"https://en.wikipedia.org/wiki/Desktop_computer\">desktop computers</a>, and <a href=\"https://en.wikipedia.org/wiki/Web_application\">web applications</a> which run in <a href=\"https://en.wikipedia.org/wiki/Mobile_web_browser\">mobile web browsers</a> rather than directly on the mobile device.</p><p>Apps were originally intended for productivity assistance such as email, calendar, and contact databases, but the public demand for apps caused rapid expansion into other areas such as <a href=\"https://en.wikipedia.org/wiki/Mobile_games\">mobile games</a>, factory automation, GPS and <a href=\"https://en.wikipedia.org/wiki/Location-based_services\">location-based services</a>, order-tracking, and ticket purchases, so that there are now millions of apps available. Many apps require <a href=\"https://en.wikipedia.org/wiki/Internet\">Internet</a> access. Apps are generally downloaded from <a href=\"https://en.wikipedia.org/wiki/App_store\">app stores</a>, which are a type of <a href=\"https://en.wikipedia.org/wiki/Digital_distribution\">digital distribution</a> platforms.</p><p>The term \"app\", short for \"<a href=\"https://en.wikipedia.org/wiki/Application_software\">software application</a>\", has since become very popular; in 2010, it was listed as \"<a href=\"https://en.wikipedia.org/wiki/Word_of_the_Year\">Word of the Year</a>\" by the <a href=\"https://en.wikipedia.org/wiki/American_Dialect_Society\">American Dialect Society</a>.</p>');
